import "./style.css";

function Service(){
    return(
        <div className="service">

            <div className="truck">
                <h1>Truck shipping</h1>
            </div>
            <p>We are proud to be one of the biggest Truck Shipping companies in the US.


Traveling across all of the 49 US states (with Hawaii available only for Air or Ocean Shipping), we offer these services:



Full Load


Harness the power of one of the largest carrier networks in Europe for flexible options and on time deliveries.



Part Load & Groupage
</p>

            <div className="ocean"></div>

            <div className="railway"></div>
        </div>
    )
}

export default Service;
